INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('40882062', 'Ballotins de dinde', '33% filet de dinde (origine France), 22% viande de dinde (origine France), 12% barde de porc, gras de porc, eau, foie de poulet, 6,6% champignons forestiers réhydra - tés dont (3,6% bolets et 3% cèpes), chapelure (farine de blé, sel), sirop de glucose, sel, arômes naturels, conservateurs : lactate de potassium et acétates de sodium, poudre de lait partiellement écrémé, fond de champignons, fibre de blé, 0,8% champignons noirs réhydra - tés, huile de tournesol, épices, extraits de bolets, dextrose, antioxydant : ascorbate de sodium, plantes aromatiques. Traces éventuelles d\'œufs. Conseil de préparation (au four traditionnel) : préchauffer votre four pendant 15 minutes à 1800C(th, 6). Retirer les ballotins de dinde de I \' emballage et les placer dans un plat allant au four, Ajouter 10 cl d\'eau dans le plat, les couvrir de lamelles de beurre. Faire cuire 25 minutes environ. Arroser régulièrement avec le jus de cuisson. Si les produits deviennent trop dorés, les recouvrir d \' une feuille de papier aluminium.', 'https://static.openfoodfacts.org/images/products/40882062/front_fr.4.400.jpg', '20', '7.2', '4.3', '1', '', '15', '1.2', '0.47244094488189', '', '0');

